<script>
import { gsap } from 'gsap';

export default {
	name: 'WorldMap',
	props: {
		currentCountry: {
			type: String,
			default: '',
		},
	},
	data() {
		return {
			lastCountry: '',
		};
	},
	watch: {
		currentCountry() {
			this.zoom();
			if (this.lastCountry) document.getElementById(this.lastCountry).classList.remove('current');
			document.getElementById(this.currentCountry).classList.add('current');
			this.lastCountry = this.currentCountry;
			this.zoom(this.currentCountry);
		},
	},
	mounted() {
		if (this.currentCountry) {
			document.getElementById(this.currentCountry).classList.add('current');
			this.lastCountry = this.currentCountry;
			this.zoom(this.currentCountry);
		}
	},
	methods: {
		zoom(selector) {
			const worldmap = document.getElementById('worldmap');
			const el = selector ? document.getElementById(selector) : document.getElementById('worldmap');
			let { x, y, width, height } = selector ? el.getBBox() : { x: 0, y: 0, width: 800, height: 387 };
			x -= 1;
			y -= 1;
			width += 2;
			height += 2;
			if (width / 800 > height / 387) {
				const diff = (width / 800) * 387 - height;
				height += diff;
				y -= diff / 2;
			} else {
				const diff = (height / 387) * 800 - width;
				width += diff;
				x -= diff / 2;
			}
			gsap.to(worldmap, {
				duration: selector ? 3 : 1,
				attr: {
					viewBox: `${x} ${y} ${width} ${height}`,
				},
				delay: selector ? 3 : 0,
			});
		},
	},
};
</script>

